import React, { Component } from 'react';
import TodoItem from './TodoItem';

class TodoList extends Component {
	render() {
		const todos = this.state.todos.map((t) => <TodoItem key={t._id} {...t} />);
		return (
			<div>
				<h1>Todo List</h1>
				<ul>{todos}</ul>
			</div>
		);
	}
}

export default TodoList;
